import React, { Component } from 'react';
import styles from'./ClickableCard.css';
import { addUpload } from '../../containers/action';
import { fileUpload } from '../../containers/fileAction';
import { setFunction} from '../../containers/setFunction';
import {connect} from 'react-redux';
import { AiOutlineDelete } from 'react-icons/ai';
import { FaTrash } from 'react-icons/fa'
import { FaTrashAlt } from "react-icons/fa";
import DeleteIcon from "./../library/Delete-icon.svg"
import { async } from 'regenerator-runtime';
import apiService from '../../../apiService.js';



export class CardsProjects extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isModalOpen: false
        };
    }
    openModal = () => {
        this.setState({ isModalOpen: true });
    }
    
    closeModal = () => {
        this.setState({ isModalOpen: false });
    }

    componentDidMount() {
        document.addEventListener('click', this.handleClickOutside);
        this.props.projectData;
    }
    
    componentWillUnmount() {
        document.removeEventListener('click', this.handleClickOutside);
    }
    
    handleClickOutside = (event) => {
        if (this.modalRef && !this.modalRef.contains(event.target)) {
            this.closeModal();
        }
    }
    

    handleCardClick = () => {
        
      
        const findId = this.props.projectData;
        if (findId && findId) {
            this.props.addUpload(findId);
            this.props.setFunction(findId);
        }
     
        this.props.onRequestCardClose();
    }

   

    deleteAction(action, name) {
        const names =  name.slice(0, -4)
          this.props.deleteId(action, names)
      }
   
    render() {
        const { id, name, thumbnail } = this.props.projectData;
        const isModalOpen = this.state.isModalOpen;

//         const arrayBuffer = new Uint8Array(thumbnail?.data);
// const base64String = btoa(String.fromCharCode(...arrayBuffer));


// const url = base64String// Your URL here
// const base64Data = url.match(/base64(.+)/)[1];

// const mimeType = 'image/png';
// const dataURL = `data:${mimeType};base64,${base64Data}`;

// const urlWithoutLastChar = dataURL.slice(0, -1);

const url = `data:image/png;base64,`

        return (
            <div ref={(node) => (this.modalRef = node)} className={`${styles?.container} ${isModalOpen ? styles?.blur : ''}`}>
                <div className={styles?.card}  onClick={this.handleCardClick}>
             <img src={url} className={styles?.cardimg} /> 
                <h2>{name.slice(0, -4)}</h2>
                
                {/* <img src={DeleteIcon} className={styles?.deleteButton} onClick={this.openModal}/> */}
           </div>
           <img src={DeleteIcon} className={styles?.deleteButton} onClick={()=>this.deleteAction(id, name)}/>

            
        </div>
           
            
        )
    }
}
const mapDispatchToProps = dispatch => ({
    addUpload: (todo) => dispatch(addUpload(todo)),
    fileUpload: (files)=> dispatch (fileUpload(files)),                                                                                                                                                                     
    setFunction : (findId) => dispatch(setFunction(findId))                                                                                                                           
  });

export default connect(null, mapDispatchToProps)(CardsProjects);